NO BEAN TURKEY CHILI 🌶 

INGREDIENTS
2 tbsp olive or avocado oil
1 onion, diced, white, yellow, or red
1 green bell pepper, diced
2 tbsp garlic, minced
2 lb lean ground turkey
2 cups chicken stock
28 oz canned diced tomatoes, I prefer fire-roasted.
4 1/2 oz canned chopped green chiles
6 oz tomato paste
3 tbsp chili powder
1 tbsp dried oregano
2 tsp onion powder
1 1/2 tsp paprika
1 1/2 tsp cumin
1 1/2 tsp salt
1 tsp pepper

INSTRUCTIONS
Add oil to a large soup pot and heat to medium-high heat. Once hot, add onions and bell pepper. Sauté until onion is translucent, approximately 3 minutes. Add minced garlic and sauté until golden, about 1 minute.
Add the ground turkey, using your spatula to crumble it. Sauté the meat, stirring occasionally, until no longer pink.
Add in all other ingredients. Stir to combine. Simmer for 15 to 20 minutes. Taste and add extra salt or seasonings if desired.  #ketochili #drinkyourketones #momfuel #girlmom #mamaoftwo #chili #avocado🥑 #lowcarbdinner #lowcarbmeals #keto #justpruvit #pruvit #findmeonfacebook #theketosismama";}i:147;a:1:{s:14:"comments_count";i:3;}i:148;a:1:{s:11:"likes_count";i:2;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvQAlMlisM";}i:150;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118798104_364701244656938_6817529470953269140_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=qnTgaQl_AVAAX_DdkTJ&oh=b55eb8a262d494ebf3a3c9b90ccfa62c&oe=5F7B79A6";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:40466562530;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391199636792844878";}i:157;a:1:{s:10:"short_code";s:11:"CEvP2aKFKJO";}i:158;a:1:{s:12:"created_time";i:1599273231;}i:159;a:1:{s:7:"caption";s:381:"Cappuccino [P 160] but spicy, I don't think they're selling this anymore soz 🙏
