1 Tbs EVOO
3 Green spring onions (tops only)
1 tsp. Salt
1/4 tsp. Pepper
1 tsp. Oregano
1/2 tsp. Chili powder
1/2 tsp. Cumin
1/4 tsp. Chipotle Jalapeño powder
1/4 tsp. Cinnamon
2 large sweet potatoes, skinned and chopped
1 red pepper, diced
1 orange pepper, diced
1 seeded jalapeno 
1/2 can pumpkin
28oz crushed tomatoes with basil

In large pot add oil until hot. Add peppers, jalapeno, green onions and sweet potatoes. Saute for 5-6 minutes or until peppers are soft. Add seasonings and stir.

Next add pumpkin and tomatoes and cook on medium high heat until sweet potatoes are cooked, 15-20min.

Serve with a dollop of unsweetened plain coconut yogurt.

